let width=window.innerWidth/100;
let height=window.innerHeight/100
export const res2={
    stats:{
        image:function(image)
        {
            let style={
                width:`${10*width}px`,
                height:`${20*height}px`,
                position:'relative',
                top:`${5*height}px`,
                backgroundImage:`url(${image})`,
            }
            return style;
        }
    }
}
